class MainSection extends Component {
    render() {
        return (
            <section className='main-section'>
                <div className='task-list form-group'>
                    <div>
                        <input type='checkbox' className='checkbox'/>
                        <input type='text' className='text'/>
                    </div>
                    <div>
                        <input type='checkbox' className='checkbox'/>
                        <input type='text' className='text'/>
                    </div>
                </div>
                <div></div>
            </section>
        )
    }
}

export default MainSection;
